import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AddShoe from './AddShoe';

const DashboardPage = () => {
  const [shoes, setShoes] = useState([]);

  const handleAddShoe = (shoe) => {
    setShoes((prevShoes) => [...prevShoes, shoe]);
  };

  return (
    <div>
      <header>
        <div className="title-container">
          <h1>SHOE COLLECTION</h1>
        </div>
        <nav className="nav-links-container">
          <Link to="/addshoe" className="add-shoe-button">
            Add Shoe
          </Link>
          <Link to="/" id="logout-button">
            Log Out
          </Link>
        </nav>
      </header>
      <main className="login-main">
        {/* Display the added shoes */}
        <ul>
          {shoes.map((shoe, index) => (
            <li key={index}>{shoe}</li>
          ))}
        </ul>
      </main>
      <footer>
        <p>Copyright Â© 2023 Shoe Collection</p>
      </footer>
      {/* Pass the handleAddShoe function to the AddShoe component */}
      <AddShoe onAddShoe={handleAddShoe} />
    </div>
  );
};

export default DashboardPage;
